import React from 'react';
import './header.scss';
import Logo from '/src/images/logo.svg';

function Navbar() {
  return (
    <div className='navbar'>
        <div className='left'>
            <img src={Logo}/>
        </div>
        <div className='right'></div>
    </div>
  )
}

export default Header
